oxy_webhelp_navlinks = {"mail_get_started.dita-d4800e2088":{"topics":[{"title":"Who appears in the type-ahead list when I address an email?","shortdesc":"<p class=\"shortdesc\">When you address an email or a meeting invitation, a list of names and addresses appears as you type. The people in that list are your recent contacts. They are chosen automatically, based on the people with whom you recently emailed, chatted, and had meetings.<\/p>","href":"mail_recent_contacts_t.html","attributes":{"data-id":"mail_recent_contacts_t"},"menu":{"hasChildren":false},"tocID":"mail_recent_contacts_t-d4800e2099","topics":[]},{"title":"What is a vCard?","shortdesc":"<p class=\"shortdesc\">A vCard contains contact information, such as title, phone numbers, and email addresses. You can use vCards to add someone to your contacts list, or to make it easier for people to add you to their contacts list. You can also use vCards to import or export multiple contacts in one file.<\/p>","href":"con_vcard_c.html","attributes":{"data-id":"con_vcard_c.dita"},"menu":{"hasChildren":false},"tocID":"con_vcard_c.dita-d4800e2110","topics":[]}]}};